description:
Bob the robot loves treasure. But Bob is not just any robot. He's a robot-pirate. He's not interested in sea adventures, battles, or distant shores. All he wants is treasure. 

But Bob needs your help. He's not very bright, and while gold is great, it doesn't help him get smarter. This is why he needs you!

Help Bob fill his treasure chest with gold coins. Solve puzzles and use a variety of items and tricks to bring all of the gold you find to Bob. 

Vivid graphics, exciting levels, and a sea of gold are waiting for you!
